    if(!video)  return <div></div>
    const VideoSrc= `https://www.youtube.com/embed/${video.id.videoId}`

    return (
       <VideoCard> 
         {/* <VideoCardInnner>  */}

              <iframe src={VideoSrc} />


                 {video.snippet.title}


         {/* </VideoCardInnner>  */}
       </VideoCard>


    )
};
export default VideoItem;

const VideoCard = styled.div`
width: 40%;
margin-bottom: 60px;
box-sizing: border-box;
line-height: 1.7;
`

